{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/vishalpatel1266/case-study-1-annual-members-vs-casual-members?scriptVersionId=130900033\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"99b36cee","metadata":{"_cell_guid":"00342360-fb97-4316-939a-2aeb40faed6f","_execution_state":"idle","_uuid":"9affb394-5606-4209-903e-90d1d1baf5fe","papermill":{"duration":0.014354,"end_time":"2023-05-24T23:09:51.42531","exception":false,"start_time":"2023-05-24T23:09:51.410956","status":"completed"},"tags":[]},"source":["# Which membership tier will be more profitable?"]},{"cell_type":"markdown","id":"e2cbba97","metadata":{"_cell_guid":"dd49396a-3b0a-4f35-b6f0-43a4af9255f5","_uuid":"e15ebf9c-a889-45df-807c-c8a0850b2ead","papermill":{"duration":0.012761,"end_time":"2023-05-24T23:09:51.450824","exception":false,"start_time":"2023-05-24T23:09:51.438063","status":"completed"},"tags":[]},"source":["### About the company\n","\n","In 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown to a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations across Chicago. The bikes can be unlocked from one station and returned to any other station in the system anytime.\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Business has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends."]},{"cell_type":"markdown","id":"ebc23a19","metadata":{"_cell_guid":"bb68deed-9fb0-4e20-8667-3c4d264a9c04","_uuid":"c5b70632-31c3-4452-b969-4ca2bfc1cc53","papermill":{"duration":0.013871,"end_time":"2023-05-24T23:09:51.477434","exception":false,"start_time":"2023-05-24T23:09:51.463563","status":"completed"},"tags":[]},"source":["## Business Tasks:\n","- How do annual members and casual riders use Cyclistic bikes differently? \n","- How can Cyclistic use digital media to influence casual riders to become members?\n","- Why would casual riders buy Cyclistic annual memberships?"]},{"cell_type":"markdown","id":"1adc7649","metadata":{"_cell_guid":"8af60039-f499-44ba-9348-494cf81a753c","_uuid":"8f579467-01fe-4020-a4cd-1daae9bedbb8","papermill":{"duration":0.013518,"end_time":"2023-05-24T23:09:51.503539","exception":false,"start_time":"2023-05-24T23:09:51.490021","status":"completed"},"tags":[]},"source":["### About the Dataset:\n","- The dataset consists of 12 files which conisits ride history data of each month  \n","- The data has been made available by Motivate International Inc. under this [license](https://ride.divvybikes.